import ColumnFilter from './Coloumnfilter'
export const COLUMN=[
    {
        Header:'Id',
        Footer:'id',
        accessor:'id',
        Filter:ColumnFilter
    },
    {
        Header:'FirstName',
        Footer:'FirstName',
        accessor:'first_name',
    },
    {
        Header:'Last Name',
        Footer:'Last Name',
        accessor:'last_name'
    },
    {
        Header:'Email',
        Footer:'Email',
        accessor:'email'
    },
    {
        Header:'Gender',
        Footer:'Gender',
        accessor:'gender'
    },
    {
        Header:'Age',
        Footer:'Footer',
        accessor:'age'
    },
    

]
